function Row({title, fetchrequest}){
    const [movies,setMovies]=useState([]);
    useEffect(()=>{
        request();
    }, [fetchrequest]);

    const request = async() => {

        const reponse = await fetch(`https://api.themoviedb.org/3//trending/all/week?api_key=c95b5c7250079e204e0356858ae6f7d5&language=en-US`)

        const data =await reponse.json();
        setMovies(data.results);
        return data.results;


    }
 return(
    <div>
        <h1>title</h1>
        {movies.map( src =>(
            <img src={src.backdrop_path}/>
        ))}

    </div>
 ); 
}
